import React from "react";

const LoginPage = () => {
    return(
        <>
            <div className="login-page">
                <div className="login-component">
                    <h1>Login Page</h1>
                </div>
                <div>
                    <h3>Login</h3>
                </div>
            </div>
        </>
    )
}

export default LoginPage
